function Tabel(props) {
    const menus = props.menu
    return (
      <div className="App">
        <h1>Menu Restoran</h1>
        <div>
            <table>

          {menus.map((data) =>(
            <li key={data.idmenu}>{data.menu} Rp. {data.harga}</li>
          ))}
          </table>
        </div>
      </div>
    )
  }
  
  export default Tabel;
